import React  from "react"

function Team( { teamChars , setTeamChars} ) {

    const assistArray = ["", "", ""]


    //I know I could break this apart but it works like this and i might do it later
    //why cant we make verticle tables? i have to break down each of my objects so much
    //for them to work in this format
    const charNames = teamChars.map((char) => {
        const strengths = char.strengths.text.map((str) => str+"\n")
        return (
            <td key={char.name} title={strengths}>{char.name}</td>
        )
    })

    const charImages = teamChars.map((char) => {
        const weaknesses = char.weaknesses.text.map((str) => str+"\n")
        return (
            <td key={char.images.mainImage} title={weaknesses}><img src={char.images.mainImage} className="teamImages" alt=""/></td>
        )

    })

    const charAssists = assistArray.map(() => {
        return (
            <td>
                <select>
                    <option className="A">A</option>
                    <option className="B">B</option>
                    <option className="C">C</option>
                </select>
            </td>
        )
    })

    const charStrengths = teamChars.map((char) => {
        const filler = char.strengths.keywords.sort().map((word) => {
            return (
                    <ul className="details">+{word}</ul>
            )
        })
        return (
            <td>{filler}</td>
        )
    })

    const charWeaknesses = teamChars.map((char)=>{
        const filler = char.weaknesses.keywords.sort().map((word) => {
            return (
                    <ul className="details">-{word}</ul>

            )
        })
        return (
            <td>{filler}</td>
        )
    })

    const charRoles = teamChars.map((char) => {
            const prePos = ((char.positions.point[0]==1)?"Point":(char.positions.mid[0]==1?"Mid":"Anchor"))
            return (
                <td>{prePos}</td>
            )
})

    const removeButtons = teamChars.map((char) => {
        function handleRemove(e){
            setTeamChars(teamChars.filter((char)=> char.id != e.target.id))
        }
        return (
            <td><button onClick={handleRemove} id={char.id}>Remove</button></td>
        )
    })

    const teamStrengths = charStrengths.map((obj)=>{
        const filler = obj.props.children.map((obj2)=>{

            return <span className="details">{obj2.props.children}  </span>
        })
        return ( <div colSpan={3}>{filler}</div>)
    })

    const teamWeaknesses = charWeaknesses.map((obj)=>{
        const filler = obj.props.children.map((obj2)=>{
            return <span className="details">{obj2.props.children}  </span>
        })
        return ( <div colSpan={3}>{filler}</div>)
    })
    const overallW = teamWeaknesses.map((obj) => {
        const weaknessArray=obj.props.children.map((obj2) =>{
            return obj2.props.children[0][1]
        })
        return weaknessArray.sort()
    })
    const overallS = teamStrengths.map((obj) => {
        const strengthsArray=obj.props.children.map((obj2) =>{
            return obj2.props.children[0][1]
        })
        return strengthsArray.sort()
    })
    const flatStr = null
    const flatWkn = overallW.flat().sort()
    const flawless = overallS.flat().sort().filter((keyword) => !flatWkn.includes(keyword))
    const flaws = flatWkn.filter((keyword) => !flatStr.includes(keyword))
    const trueFlawless = [...new Set(flawless)]
    const trueFlaws = [...new Set(flaws)]
    console.log(trueFlaws)
    const teamTrueFlawless = trueFlawless.map((word) => {
        return (
            <span className="details">+{word}  </span>
        )
    })
    const teamTrueFlaws = trueFlaws.map((word) => {
        return (
            <span className="details">-{word}  </span>
        )
    })

    return (
        <div id="tableHolder">
        <table id="teamCharTable">
            <tbody>
                <tr className="teamCharContainer">
                    <td> </td>
                    <td>Point</td>
                    <td>Mid</td>
                    <td>Anchor</td>
                </tr>
                <tr className="teamCharContainer">
                    <td>Name</td>
                    {charNames}
                    {charNames[0]?null:<td/>}
                    {charNames[1]?null:<td/>}
                    {charNames[2]?null:<td/>}
                </tr>
                <tr className="teamCharContainer">
                    <td>Image</td>
                    {charImages}
                    {charImages[0]?null:<td/>}
                    {charImages[1]?null:<td/>}
                    {charImages[2]?null:<td/>}
                </tr>
                <tr className="teamCharContainer">
                    <td>Assist</td>
                    {charAssists}
                    {charAssists[0]?null:<td/>}
                    {charAssists[1]?null:<td/>}
                    {charAssists[2]?null:<td/>}
                </tr>
                <tr className="teamCharContainer">
                    <td>Strengths</td>
                    {charStrengths}
                    {charStrengths[0]?null:<td/>}
                    {charStrengths[1]?null:<td/>}
                    {charStrengths[2]?null:<td/>}
                </tr>
                <tr className="teamCharContainer">
                    <td>Weaknesses</td>
                    {charWeaknesses}
                    {charWeaknesses[0]?null:<td/>}
                    {charWeaknesses[1]?null:<td/>}
                    {charWeaknesses[2]?null:<td/>}
                </tr>
                <tr className="teamCharContainer">
                    <td>Preferred Role</td>
                    {charRoles}
                    {charRoles[0]?null:<td/>}
                    {charRoles[1]?null:<td/>}
                    {charRoles[2]?null:<td/>}
                </tr>
                <tr className="teamCharContainer">
                    <td>Team Strengths</td>
                    <td colSpan={3}>{teamStrengths}</td>
                </tr>
                <tr className="teamCharContainer">
                    <td>Team Weaknesses</td>
                    <td colspan={3}>{teamWeaknesses}</td>
                </tr>
                <tr className="teamCharContainer">
                    <td>Overall </td>
                    <td colSpan={3}>
                        <div>{teamTrueFlawless}</div>
                        <div>{teamTrueFlaws}</div>
                    </td>
                </tr>
                <tr className="buttonContainer">
                    <td>Remove</td>
                    {removeButtons}
                </tr>
            </tbody>
        </table>
        <br></br>
        </div>

    )
}

export default Team;
